INSERT INTO `Story` VALUES (2,'수요미식회 방송맛집','디저트, 보리굴비, 여수 맛집은?','https://mp-seoul-image-production-s3.mangoplate.com/mango_pick/dzzjp8qdqxcb8y.jpg','2018-09-07 21:44:00','http://k.kakaocdn.net/dn/baSSVJ/btqmthM6cBp/ikqEwepJiqwQK4GyV09d3k/profile_640x640s.jpg','양사랑',1121,1),(3,'분식이 기가 막혀! 떡볶이 vs 김밥 맛집','올리브<여기GO> 16화 맛집랭킹 대공개!','https://mp-seoul-image-production-s3.mangoplate.com/mango_pick/qr2u2o0mxcmdue.png','2018-09-08 11:37:40','http://k.kakaocdn.net/dn/baSSVJ/btqmthM6cBp/ikqEwepJiqwQK4GyV09d3k/profile_640x640s.jpg','양사랑',3321,1),(4,'서울에서 만나는 세계 여행','홀릭  \'토요미식회장\' 님의 초이스!','https://mp-seoul-image-production-s3.mangoplate.com/mango_pick/bab9wwkrsvqjdh.jpg','2018-09-08 11:38:48','http://k.kakaocdn.net/dn/baSSVJ/btqmthM6cBp/ikqEwepJiqwQK4GyV09d3k/profile_640x640s.jpg','양사랑',1223,1),(5,'육식대첩! 돼지고기 vs 소고기 맛집','고기 러버들은 모여라!','https://mp-seoul-image-production-s3.mangoplate.com/mango_pick/3u4y_1ezokk8tk.jpg','2018-09-08 11:40:23','http://k.kakaocdn.net/dn/baSSVJ/btqmthM6cBp/ikqEwepJiqwQK4GyV09d3k/profile_640x640s.jpg','양사랑',3231,1),(6,'9월 추천 전국 신상맛집','가을과 함께 식욕도 돌아온다..\r\n','https://mp-seoul-image-production-s3.mangoplate.com/mango_pick/6e38cvpd8kkkcb.jpg','2018-09-08 11:41:01','http://k.kakaocdn.net/dn/baSSVJ/btqmthM6cBp/ikqEwepJiqwQK4GyV09d3k/profile_640x640s.jpg','양사랑',112,1),(7,'이색 면 요리 맛집 10곳','올리브 <여기GO> 14화 맛집랭킹 대공개!','https://mp-seoul-image-production-s3.mangoplate.com/mango_pick/mvr7uu-7htqwiw.png','2018-09-08 11:41:48','http://k.kakaocdn.net/dn/baSSVJ/btqmthM6cBp/ikqEwepJiqwQK4GyV09d3k/profile_640x640s.jpg','양사랑',4432,1),(8,'감자 디저트 맛집','구황작물 좋아해? 이 안에 감자있다..','https://mp-seoul-image-production-s3.mangoplate.com/mango_pick/ctsz70kkc9mmff.jpg','2018-09-08 11:42:33','http://k.kakaocdn.net/dn/baSSVJ/btqmthM6cBp/ikqEwepJiqwQK4GyV09d3k/profile_640x640s.jpg','양사랑',4443,1),(9,'토박이가 추천하는 울산 맛집 7곳','홀릭 \'myounG\'님의 초이스!','https://mp-seoul-image-production-s3.mangoplate.com/mango_pick/qzupuqvouui3zc.jpg','2018-09-08 11:43:04','http://k.kakaocdn.net/dn/baSSVJ/btqmthM6cBp/ikqEwepJiqwQK4GyV09d3k/profile_640x640s.jpg','양사랑',554,1),(10,'밥블레스유 방송맛집','밥잘먹는 언니들의 추천맛집!','https://mp-seoul-image-production-s3.mangoplate.com/mango_pick/il9dhx33upp8ht.jpg','2018-09-08 11:44:14','http://k.kakaocdn.net/dn/baSSVJ/btqmthM6cBp/ikqEwepJiqwQK4GyV09d3k/profile_640x640s.jpg','양사랑',667,1);
