INSERT INTO `StoryDetail` VALUES (58,10,1,'https://mp-seoul-image-production-s3.mangoplate.com/mango_pick/mr7261dvicjtyl.jpg?',4,0,123,'111'),(59,10,2,'22',12,1,123,'222'),(60,10,3,'33',1,2,123,'333'),(72,2,3,'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsQAAA7EAZUrDhsAAAANSURBVBhXYzh8+PB/AAffA0nNPuCLAAAAAElFTkSuQmCC',5,0,123,'지금 제철을 맞아 더욱 단맛이 살아있는 새우. 오늘은 남녀노소 누구나 좋아하는 새우요리 맛집을 소개해 드리려고 해요~'),(73,2,4,'https://mp-seoul-image-production-s3.mangoplate.com/mango_pick/iqcq8jctxokof7.jpg?fit=around|600:600&crop=600:600;*,*&output-format=jpg&output-quality=80',12,1,123,'< 서울 역삼동: 구르메간장새우 > 독도 꽃새우, 닭새우를 비롯해 새우튀김, 새우구이 간장새우까지 해산물 천국인 이곳. 특히 꽃새우, 닭새우 회는 단맛의 절정!'),(74,2,5,'https://mp-seoul-image-production-s3.mangoplate.com/mango_pick/g6zdgddpyxrjaw.jpg?fit=around|600:600&crop=600:600;*,*&output-format=jpg&output-quality=80',15,2,123,'술집분위기에 가까운 해산물전문점이지만 이곳의 간장새우는 짜지도 않고 감칠맛이 예술이라 밥한공기 비우고 한잔 하시죠?!'),(75,2,-1,'https://mp-seoul-image-production-s3.mangoplate.com/mango_pick/gvxqzm9hyq9nej.jpg?fit=around|600:600&crop=600:600;*,*&output-format=jpg&output-quality=80',1,3,123,'< 서울 연남동: 산왕반점 > 가성비 훌류하다고 소문난 연남동 중식당. 특히 식빵 사이에 새우로 속을 채우고 튀겨낸 중국식 새우토스 멘보샤가 맛있기로 소문났다고!');
