INSERT INTO `ToplistDetail` VALUES (17,1,1,'https://mp-seoul-image-production-s3.mangoplate.com/1109570_1539715755741884.jpg?fit=around|738:738&crop=738:738;*,*&output-format=jpg&output-quality=80',0,'다로베',5,'서울시 성동구 성수동1가 668-3','https://mp-seoul-image-production-s3.mangoplate.com/970510_1523451551595?resize=64:64','가송','저희가 먹은 메뉴는 비스마르크 피자와 포치니 크레마였어용! 가기전에 미리 사진으로 봤을때는 비쥬얼이 엄청 맛있어보이지는 않았는데 실제로 한입 먹어보니 정말 너무너무너무너무 맛있었어요ㅠㅠㅠ 흐어어엉 정말 또 가고싶다고 다짐했어요ㅠㅠ❤❤ 근데 마지막에 다 먹었을쯤에는 조금 느끼해서 다음에 재방문때는 샐러드도 시켜야겠어요!\\\'\\\'\\\''),(18,1,12,'https://mp-seoul-image-production-s3.mangoplate.com/653082_1537976239706349.jpg?fit=around|738:738&crop=738:738;*,*&output-format=jpg&output-quality=80',1,'보니스피자펍',5,'서울시 용산구 용산동2가 44-19','https://mp-seoul-image-production-s3.mangoplate.com/822474_1525193080426?resize=64:64','j2uni','카니볼+페퍼로니 한 판 시켰습니다! 사람이 너무 많아서 30~45분은 생각했는데 운이 좋았는지 원래 회전율이 빠른건지 20분도 안걸려서 착석했습니다! 매장이 좁고 셀프라 조금 불편하긴 했지만 맛있어서 재방문의사가 있어요 좀 더 가까우면 자주 갈텐데 ㅠㅠ 전 카니볼 맛있게 먹었는데 같이 간 사람들은 페퍼로니를 선호하더라고요 참고하세요!');
